import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import * as serviceWorker from './serviceWorker';
/* image imports */ 
import Logo from './images/logo.png'
import HeaderImage from './images/header-background.jpg'
import TeamWorkImg from './images/header-teamwork.svg'
import service1 from './images/services-icon-1.svg'

/* components imports */ 
import Page from './components/Page/Page'
import Hero from './components/Hero/Hero'
import Section from './components/Section/Section';
import Card from './components/Card/Card';

ReactDOM.render(
  <React.StrictMode>
    <Page logo={Logo}/>
      <Hero title="Laerte Silva" subtitle="Melhor contador de BH" img={TeamWorkImg} call="Contate"/>
      <Section title="Servicos" subtitle="Conheca o que podemos fazer por voce!">
        <Card title="Servico 1" description="Servico bacana" src="./images/services-icon-1.svg"/>
        <Card/>
        <Card/>
      </Section>
  </React.StrictMode>,
  document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
